import React, { Component } from 'react';
import imagenFondo from '../assets/images/mandalorian.jpg'; // imagen de la persona

class LastUserInDb extends Component {

    constructor() {
        super();
        this.state = {
            cartProps: []
        }
    }

    componentDidMount() {
        fetch('http://localhost:3030/API/books/')
            .then(res => res.json())
            .then(data => this.setState({ cartProps: data.data }))
            .catch(e => console.log(e));


    }

    mouse() {
        const cardBody = document.querySelector('.card2');
        cardBody.classList.toggle('bg-secondary');
    };

    render() {
        return (
            <React.Fragment>

                <div className="col-lg-6 mb-4">
                    <div className="card shadow mb-4">
                        <div className="card-header py-3">
                            <h5 className="m-0 font-weight-bold text-gray-800">Ultimo usuario registrado</h5>
                        </div>
                        <div className="card-body">
                            <div className="text-center">
                                <img className="img-fluid px-3 px-sm-4 mt-3 mb-4" style={{ width: 40 + 'rem' }} src={imagenFondo} alt=" Star Wars - Mandalorian " />
                            </div>
                            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Dolores, consequatur explicabo officia inventore libero veritatis iure voluptate reiciendis a magnam, vitae, aperiam voluptatum non corporis quae dolorem culpa citationem ratione aperiam voluptatum non corporis ratione aperiam voluptatum quae dolorem culpa ratione aperiam voluptatum?</p>
                            {/*<!-- Content Row Movies-->  <a className="btn btn-danger" target="_blank" rel="nofollow" href="/">View movie detail</a>*/}
                        </div>
                    </div>
                </div>
            </React.Fragment>
        )
    }
}


export default LastUserInDb;
